import './App.css';
// 헤더
import Header from './Header';
import Footer from './Footer';

function App() {
  return (
    <div className="App">
      <Header />
        <main className="content">
        <h1>임시</h1>
      </main>
      <Footer />
    </div>
  );
}

export default App;
